          value={this.state.values.A}
          onChange={this.handleChange}
          onBlur={this.handleBlur}
        >
        </input>
        <input
          className="form-control mt-2"
          placeholder="Introduzca su contraseña"
          type="password"
          
          />
          
          <button          
          className="btn btn-success btn-lg m-2">
          OK         
          </button>
          <Link 
          className="btn btn-success btn-lg m-2"
          to={this.state.value}>
          
          MOSTRAR CITAS
          </Link>
        </form>
      </div>
    );
  }
}
